const vertices = pipeline.getContext('vertex-context').canvas;

if(!window.point_mesh_indices) {
   window.point_mesh_indices = [];
   for(var i = 0; i < vertices.width*vertices.height/32; i++) {
      window.point_mesh_indices.push(i)
   }
}

return [window.point_mesh_indices]

stages.vertices:
const vertices = pipeline.getContext('vertex-context').canvas;

if(!window.point_mesh_vertices) {
   window.point_mesh_vertices = [];
   for(var x = 0; x < vertices.width; x++) {
      for(var y = 0; y < vertices.height; y++) {
         window.point_mesh_vertices.push([
            x*1.0/vertices.width*4.,
            y*1.0/vertices.height,
            0.0,
            1.0
         ])
      }
   }
}

return [window.point_mesh_vertices];
